import React, { useState } from 'react';
import './Climb.css';

function Climb() {
    const[values, setValues] = useState({
        username: 'User123',
        gym: 'Gym',
        climbType: 'Type',
        grade: 'Grade',
        rating: 'Rating',
    })

    return (
        <div className="climb-container">

            <div className='climb-item'>
                {values.username} 
            </div>
            <div className='climb-item'>
                Type
            </div>
            <div className='climb-item'>
                Gym 
            </div>
            <div className='climb-item'>
                Grade
            </div>
            <div className='climb-item'>
                Rating 
            </div>
        </div>
    );
}

export default Climb;
